import React from 'react';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Columns from 'react-columns';
import FormDialog from './FormDialog';
import green from '@material-ui/core/colors/green'
import lightgreen from '@material-ui/core/colors/lightGreen'
import lime from '@material-ui/core/colors/lime'
// import white from '@material-ui/core/colors/white'
import { ThemeProvider, makeStyles } from '@material-ui/styles';
import { createMuiTheme } from '@material-ui/core/styles';

//TODO: bebas neue - font for title

// colors
// const basicClass = white[500];
const bestClass = green[500]; // #F44336
const recClass = lightgreen[400]; // #E040FB
const lessRecClass = lime[400];

const classTheme = createMuiTheme({
  overrides: {
    // Style sheet name ⚛️
    MuiPaper: {
      // Name of the rule
      root: {
        // Some CSS
        backgroundColor: '#FFFFFF',
      },
    },
  },
});

const bestClassTheme = createMuiTheme({
  overrides: {
    // Style sheet name ⚛️
    MuiPaper: {
      // Name of the rule
      root: {
        // Some CSS
        backgroundColor: bestClass,
      },
    },
  },
});

const recClassTheme = createMuiTheme({
  overrides: {
    // Style sheet name ⚛️
    MuiPaper: {
      // Name of the rule
      root: {
        // Some CSS
        backgroundColor: recClass,
      },
    },
  },
});

const lessRecClassTheme = createMuiTheme({
  overrides: {
    // Style sheet name ⚛️
    MuiPaper: {
      // Name of the rule
      root: {
        // Some CSS
        backgroundColor: lessRecClass,
      },
    },
  },
});





function PaperPart(props){
  const classes = useStyles();

  return(
    <Paper className = {classes.otherClass}>{props.className}</Paper>
  );
}

function GridPart(){
  const kidClass = "Kid's Taekwondo Class";
  const basicClass = "Basic Class";
  const advancedClass = "Advanced/Black Belt Class";
  const familyBBClass = "Family Class/Black Belt Class";
  const familyClass = "Family Class";

  return(
    <Grid
      container
      spacing = {1}
      direction="column"
      justify="flex-start"
      alignItems="center"
      >

      <ThemeProvider theme={classTheme}>
        <Grid item xs={12}>
          <ThemeProvider theme={bestClassTheme}>
            <PaperPart className = {kidClass}/>
          </ThemeProvider>
        </Grid>
        <Grid item xs={12}>
          <ThemeProvider theme={recClassTheme}>
            <PaperPart className = {basicClass}/>
          </ThemeProvider>
        </Grid>
        <Grid item xs={12}>
          <ThemeProvider theme={lessRecClassTheme}>
            <PaperPart className = {advancedClass}/>
          </ThemeProvider>
        </Grid>
        <Grid item xs={12}>
          {/* <ThemeProvider theme={classTheme2}> */}
            <PaperPart className = {familyBBClass}/>
          {/* </ThemeProvider> */}
        </Grid>
        <Grid item xs={12}>
          {/* <ThemeProvider theme={classTheme2}> */}
            <PaperPart className = {familyClass}/>
          {/* </ThemeProvider> */}
        </Grid>
      </ThemeProvider>
    </Grid> 
  );
}

function Component(){

    return (
    <Columns columns="4">
      <div style = {{padding: 20}}>
      <p>Monday</p>
       <GridPart/>
       </div>
       <div style = {{padding: 20}}>
       <p>Tuesday</p>

       <GridPart/>
       </div>
       <div style = {{padding: 20}}>
       <p>Wednesday</p>

       <GridPart/>
       </div>
       <div style = {{padding: 20}}>
       <p>Thursday</p>

       <GridPart/>
       </div>

    </Columns>
  );
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>
          TKC Free Trial Class Sign-up
        </h2>
        <p className="textBlurb">
          We always work around our families’ schedules. If any of these recommended times don’t work for you OR for holiday hours, please call (630) 708-3132.
        </p>
        <Component/>
      </header>
    </div>
  );
}

export default App;

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },

  otherClass: {
    padding: theme.spacing(2),
    textAlign: 'center',
    // color: theme.palette.text.secondary,
    height: 70,
    width: 200,
    fontSize: 10,
  }
}));
